import * as React from 'react';
import PropTypes from 'prop-types';
import './CourseworkTabs.css';
import Tabs from '../../mui_components/Tabs.js'
import Tab from '../../mui_components/Tab.js'

function CustomTabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
          <div>{children}</div>
      )}
    </div>
  );
}

CustomTabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

function CourseworkTabs(props) {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  return (
    <div className='coursework-tabs'>
      <Tabs
          value={value} 
          onChange={handleChange} 
          variant='scrollable' 
          centered
        >
        <Tab label="Comp Sci" {...a11yProps(0)} />
        <Tab label="Elec/Comp Engr" {...a11yProps(1)} />
        <Tab label="Finance" {...a11yProps(2)} />
        <Tab label="Business" {...a11yProps(3)} />
        <Tab label="IBE" {...a11yProps(4)} />
        <Tab label="General" {...a11yProps(5)} />
      </Tabs>
      <CustomTabPanel value={value} index={0}>
        Item One
      </CustomTabPanel>
      <CustomTabPanel value={value} index={1}>
        Item Two
      </CustomTabPanel>
      <CustomTabPanel value={value} index={2}>
        Item Three
      </CustomTabPanel>
      <CustomTabPanel value={value} index={3}>
        Item 4
      </CustomTabPanel>
      <CustomTabPanel value={value} index={4}>
        Item 5
      </CustomTabPanel>
      <CustomTabPanel value={value} index={5}>
        Item 6
      </CustomTabPanel>
  </div>
  );
}

export default CourseworkTabs;
